    for (final obj in playlists) {
      await obj.save(ignoreBatch: false);
    }
    if (!isStartedBatch) {
      result = await Model().batchCommit();
      for (int i = 0; i < playlists.length; i++) {
        if (playlists[i].id == null) {
          playlists[i].id = result![i] as int;
